import React from "react";
import { Link } from "react-router-dom";
import "./Menu.css";

function Menu(props) {
  return (
    <div className={props.isOpen ? "menu slideIn" : "menu slideOut"}>
      <ul>
        <Link to="settings">
          <li className=".menu">Settings</li>
        </Link>
        <Link to="account">
          <li className=".menu">Account</li>
        </Link>
        <Link to="about">
          <li className=".menu">About</li>
        </Link>
        <Link to="contacts">
          <li className=".menu">Contacts</li>
        </Link>
      </ul>
    </div>
  );
}

export default Menu;
